description:
The NSA is Coming to Town

Sociopolitical Documentary hosted by Richard Gizbert, published by Al-Jazeera broadcasted as part of Al-Jazeera Listening Post series in 2013 - English narration


Information
------------------------------

Protests, propaganda and the power struggle dominating Ukraine's airwaves. Plus, the slow TV phenomenon in Norway and the American Civil Liberties Union Santa parody song &quot;The NSA is Coming to Town&quot;.

